2	{"folha de pagamento","eventos da folha",efolha}	17	f		7	0	2016-10-04 10:06:02-03	2016-12-20 15:25:32.461606-02	RH - Digitao da Folha de Pagto atravs do Portal	A Sulprog possui uma plataforma Web chamada Portal eFolha que disponibiliza diversos servios de apoio s suas operaes comerciais junto aos clientes (ex: emisso de boletos, 2a. via, Ativao de Mdulos do WSoluo etc).\n\nOs clientes que utilizam o WSoluo gostariam de ter uma forma de integrao facilitada com os seus contadores para publicao mensal dos Eventos da Folha de Pagamento.\n\nA Sulprog entende que o Portal eFolha deve apoiar seus clientes facilitando a integrao de servios entre as partes interessadas (Clientes e Contadores). Desta forma, o Portal e-Folha pode ser expandido para atender s novas demandas atravs de ferramentas que atendam tanto ao Cliente (Empresa) quanto ao Contador.\n\nEsta ferramenta deve ser capaz de:\n\n1) Permitir a digitao/importao dos Eventos da Folha de Pagamento do Cliente;\n2) Oferecer ao Contador meios de processar os lanamentos do Cliente e retornar os resultados atravs do mesmo canal.\n\nUS provveis:\n\n5> Disponibilizao da Folha de Pagamento no Portal e-Folha\n\nEu, Cliente WSoluo (Empresa), gostaria de disponibilizar a lista de proventos e descontos da folha de pagamento no Portal e-Folha para o meu contador.\n\n\n4> A Ferramenta de Integrao da Digitao da Folha no Portal e-Folha\n\nEu, Contador, gostaria de obter os lanamentos da Folha de Pagamento dos meus clientes atravs do WSoluo.	t	f	\N	8	2	8	#edd400
