ab278a6a-9c35-11e6-8b04-6cf049faebf5	{"pk": null, "name": "Arnaldo Diniz"}	2016-10-05 11:01:03-03	1	f	userstories.userstory:11	{"description_html": ["<p>O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. </p>\\n<p>O cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).</p>\\n<p>O cliente deseja visualizar uma tela onde contenha nas linhas todos os funcion\\u00e1rios <strong>ativos</strong> e nas colunas os eventos da folha. Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. <br>\\nA formata\\u00e7\\u00e3o das colunas de eventos dever\\u00e1 seguir a formata\\u00e7\\u00e3o: Time para eventos do tipo Hora e Valor com duas casas decimais para demais eventos. </p>\\n<p>Ap\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente deseja sinalizar para o contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo. Para isso, dever\\u00e1 ter os seguintes status: Em Digita\\u00e7\\u00e3o / Digitado.</p>", "<p>O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. </p>\\n<p>O cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).</p>\\n<p>O cliente deseja visualizar uma lista de funcion\\u00e1rios <strong>ativos</strong> com colunas os eventos da folha.</p>\\n<p>Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. <br>\\nA colunas de eventos devem estar formatadas conforme o tipo: \\"Time\\" para eventos Hora e Valor com duas casas decimais para os demais. </p>\\n<p>Ap\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente precisa sinalizar para o Contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo (Status \\"Digitado/Pronto\\").</p>"], "description": ["O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. \\n\\nO cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).\\n\\nO cliente deseja visualizar uma tela onde contenha nas linhas todos os funcion\\u00e1rios **ativos** e nas colunas os eventos da folha. Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. \\nA formata\\u00e7\\u00e3o das colunas de eventos dever\\u00e1 seguir a formata\\u00e7\\u00e3o: Time para eventos do tipo Hora e Valor com duas casas decimais para demais eventos. \\n\\nAp\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente deseja sinalizar para o contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo. Para isso, dever\\u00e1 ter os seguintes status: Em Digita\\u00e7\\u00e3o / Digitado.\\n\\n\\n\\n", "O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. \\n\\nO cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).\\n\\nO cliente deseja visualizar uma lista de funcion\\u00e1rios **ativos** com colunas os eventos da folha.\\n\\nOs eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. \\nA colunas de eventos devem estar formatadas conforme o tipo: \\"Time\\" para eventos Hora e Valor com duas casas decimais para os demais. \\n\\nAp\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente precisa sinalizar para o Contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo (Status \\"Digitado/Pronto\\")."]}	\N	{}			\N	{}	f	\N	\N	2	{"description_diff": [null, "<span>(...)c\\u00e1lculo (Mensal, Adiantamento, Complementar).<br /><br />O cliente deseja visualizar uma</spa