b896fe90-a043-11e6-b955-6cf049faebf5	{"name": "Adson Whobbert da Luz", "pk": 10}	2016-11-01 12:59:00.153636-02	1	f	userstories.userstory:20	{}	\N	{}	Acredito que a US contm alguns erros:\n\nFrias a vencer: est escrito que a data de trmino do perodo aquisitivo deve ser inferior a data atual, porm se a data de trmino do perodo aquisitivo for inferior a data atual, as frias j venceram, pois o funcionrio estaria fora do perodo aquisitivo.\n\nFrias com risco: est escrito que a data de trmino deve ser maior que a data atual mais 8 meses, porm acredito que o correto seria que a data atual deve ser maior que a data de trmino mais 8 meses.\n\nFrias vencidas: est escrito que a data de trmino deve ser maior que a data atual e menor que a data de termino mais 8 meses, acredito que o correto seria que a data atual deve ser maior que a data de trmino e menor que a data de trmino mais 8 meses.	<p>Acredito que a US contm alguns erros:</p>\n<p>Frias a vencer: est escrito que a data de trmino do perodo aquisitivo deve ser inferior a data atual, porm se a data de trmino do perodo aquisitivo for inferior a data atual, as frias j venceram, pois o funcionrio estaria fora do perodo aquisitivo.</p>\n<p>Frias com risco: est escrito que a data de trmino deve ser maior que a data atual mais 8 meses, porm acredito que o correto seria que a data atual deve ser maior que a data de trmino mais 8 meses.</p>\n<p>Frias vencidas: est escrito que a data de trmino deve ser maior que a data atual e menor que a data de termino mais 8 meses, acredito que o correto seria que a data atual deve ser maior que a data de trmino e menor que a data de trmino mais 8 meses.</p>	\N	\N	f	\N	\N	2	{}
