3e7b57b8-ad78-11e6-a437-6cf049faebf5	{"pk": 13, "name": "Arnaldo Diniz"}	2016-11-18 08:17:43.733115-02	1	f	userstories.userstory:30	{"description": ["O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha de forma global, para todas as empresas cadastradas poderem lan\\u00e7ar seus eventos de folha. \\nEsta a\\u00e7\\u00e3o gera automaticamente Compet\\u00eancia de Folha para cada empresa, onde ser\\u00e1 poss\\u00edvel observar se a Digita\\u00e7\\u00e3o est\\u00e1 dispon\\u00edvel, conclu\\u00edda ou importada.", "O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus eventos de folha atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.\\n\\nEsta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o por parte da Empresa. Os valores para o Status s\\u00e3o:\\n\\nAguardando Digita\\u00e7\\u00e3o - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;\\nDigita\\u00e7\\u00e3o 'em Andamento' - entre o preenchimento do primeiro e \\u00faltimo item da Compet\\u00eancia de uma Empresa;\\nDigita\\u00e7\\u00e3o 'Conclu\\u00edda' - aos 100% do preenchimento, sinalizando;\\nDigita\\u00e7\\u00e3o 'Pronta' - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento;\\nDigita\\u00e7\\u00e3o 'Efetivada' - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha."], "description_html": ["<p>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha de forma global, para todas as empresas cadastradas poderem lan\\u00e7ar seus eventos de folha. <br>\\nEsta a\\u00e7\\u00e3o gera automaticamente Compet\\u00eancia de Folha para cada empresa, onde ser\\u00e1 poss\\u00edvel observar se a Digita\\u00e7\\u00e3o est\\u00e1 dispon\\u00edvel, conclu\\u00edda ou importada.</p>", "<p>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus eventos de folha atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.</p>\\n<p>Esta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o por parte da Empresa. Os valores para o Status s\\u00e3o:</p>\\n<p>Aguardando Digita\\u00e7\\u00e3o - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;<br>\\nDigita\\u00e7\\u00e3o 'em Andamento' - entre o preenchimento do primeiro e \\u00faltimo item da Compet\\u00eancia de uma Empresa;<br>\\nDigita\\u00e7\\u00e3o 'Conclu\\u00edda' - aos 100% do preenchimento, sinalizando;<br>\\nDigita\\u00e7\\u00e3o 'Pronta' - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento;<br>\\nDigita\\u00e7\\u00e3o 'Efetivada' - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.</p>"]}	\N	{}			\N	\N	f	\N	\N	2	{"description_diff": [null, "<span>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha</span><ins style=\\"background:#e6ffe6;\\">,</ins><span> de forma global, para </span><ins style=\\"background:#e6ffe6;\\">que </ins><span>todas as empresas cadastradas po</span><del style=\\"background:#ffe6e6;\\">dere</del><ins style=\\"background:#e6ffe6;\\">ssa</ins><span>m lan\\u00e7ar seus eventos de folha</span><del style=\\"background:#ffe6e6;\\">. <br />Esta </del><ins style=\\"background:#e6ffe6;\\"> atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.<br /><br />Esta public</ins><span>a\\u00e7\\u00e3o gera automaticamente </span><ins style=\\"background:#e6ffe6;\\">uma </ins><span>Compet\\u00eancia de Folha para cada empresa, </span><del style=\\"background:#ffe6e6;\\">onde ser\\u00e1 poss\\u00edvel observar se a Digita\\u00e7\\u00e3o est\\u00e1 dispon\\u00edvel, conclu\\u00edda ou importad</del><ins style=\\"background:#e6ffe6;\\">definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o por parte da Empresa. Os valores para o Status s\\u00e3o:<br /><br />Aguardando Digita\\u00e7\\u00e3o - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;<br />Digita\\u00e7\\u00e3o 'em Andamento' - entre o preenchimento do primeiro e \\u00faltimo item da Compet\\u00eancia de uma Empresa;<br />Digita\\u00e7\\u00e3o 'Conclu\\u00edda' - aos 100% do preenchimento, sinalizando;<br />Digita\\u00e7\\u00e3o 'Pronta' - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento;<br />Digita\\u00e7\\u00e3o 'Efetivada' - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolh</ins><span>a.</span>"], "description_html": ["<p>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha de forma global, para todas as empresas cadastradas poderem lan\\u00e7ar seus eventos de folha. <br>\\nEsta a\\u00e7\\u00e3o gera automaticamente Compet\\u00eancia de Folha para cada empresa, onde ser\\u00e1 poss\\u00edvel observar se a Digita\\u00e7\\u00e3o est\\u00e1 dispon\\u00edvel, conclu\\u00edda ou importada.</p>", "<p>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus eventos de folha atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.</p>\\n<p>Esta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o por parte da Empresa. Os valores para o Status s\\u00e3o:</p>\\n<p>Aguardando Digita\\u00e7\\u00e3o - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;<br>\\nDigita\\u00e7\\u00e3o 'em Andamento' - entre o preenchimento do primeiro e \\u00faltimo item da Compet\\u00eancia de uma Empresa;<br>\\nDigita\\u00e7\\u00e3o 'Conclu\\u00edda' - aos 100% do preenchimento, sinalizando;<br>\\nDigita\\u00e7\\u00e3o 'Pronta' - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento;<br>\\nDigita\\u00e7\\u00e3o 'Efetivada' - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.</p>"]}
