46546202-ad93-11e6-a437-6cf049faebf5	{"pk": 9, "name": "Claudio Maia"}	2016-11-18 11:31:13.311277-02	1	f	userstories.userstory:30	{"description": ["O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus Eventos de Folha, para cada Funcion\\u00e1rio, atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.\\n\\nEsta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada Empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o. Os valores para o Status s\\u00e3o:\\n\\nAguardando Digita\\u00e7\\u00e3o - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;\\nDigita\\u00e7\\u00e3o 'em Andamento' - entre o preenchimento do primeiro e \\u00faltimo item da Compet\\u00eancia de uma Empresa;\\nDigita\\u00e7\\u00e3o 'Conclu\\u00edda' - aos 100% do preenchimento, sinalizando;\\nDigita\\u00e7\\u00e3o 'Pronta' - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento pelo Escrit\\u00f3rio Cont\\u00e1bil;\\nDigita\\u00e7\\u00e3o 'Efetivada' - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.", "O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus Eventos de Folha, para cada Funcion\\u00e1rio, atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.\\n\\nEsta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada Empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o. Os valores para o Status s\\u00e3o:\\n\\nDigita\\u00e7\\u00