ita\\u00e7\\u00e3o da Folha s\\u00e3o:</p>\\n<p>Pendente - no ato do registro de uma Compet\\u00eancia;<br>\\nPronta - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento pelo Escrit\\u00f3rio Cont\\u00e1bil;<br>\\nImportada - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.</p>"]}	\N	{}			\N	\N	f	\N	\N	2	{"description_diff": [null, "<span>O Operador </span><del style=\\"background:#ffe6e6;\\">Cont\\u00e1bil</del><ins style=\\"background:#e6ffe6;\\">Empresa</ins><span> poder\\u00e1 </span><del style=\\"background:#ffe6e6;\\">public</del><ins style=\\"background:#e6ffe6;\\">registr</ins><span>ar uma Compet\\u00eancia de Folha</span><del style=\\"background:#ffe6e6;\\">, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus Eventos</del><ins style=\\"background:#e6ffe6;\\"> permitindo a Digita\\u00e7\\u00e3o</ins><span> d</span><del style=\\"background:#ffe6e6;\\">e</del><ins style=\\"background:#e6ffe6;\\">a</ins><span> Folha</span><del style=\\"background:#ffe6e6;\\">, para cada Funcion\\u00e1rio,</del><span> atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico </span><del style=\\"background:#ffe6e6;\\">no portal.<br /><br />Esta publica\\u00e7\\u00e3</del><ins style=\\"background:#e6ffe6;\\">conforme os Eventos configurados pelo Escrit\\u00f3rio Cont\\u00e1bil.<br /><br />Este registr</ins><span>o gera automaticamente uma Compet\\u00eancia de Folha para </span><del style=\\"background:#ffe6e6;\\">cad</del><span>a Empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia(...)Digita\\u00e7\\u00e3o da Folha s\\u00e3o:<br /><br />Pendente - no ato d</span><del style=\\"background:#ffe6e6;\\">a publica\\u00e7\\u00e3</del><ins style=\\"background:#e6ffe6;\\">o registr</ins><span>o de uma Compet\\u00eancia;<br /></span><del style=\\"background:#ffe6e6;\\">Digitada - aos 100% do preenchimento, sinalizando;<br /></del><span>Pronta - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que(...)</span>"], "description_html": ["<p>O Operador Cont\\u00e1bil poder\\u00e1 publicar uma Compet\\u00eancia de Folha, de forma global, para que todas as empresas cadastradas possam lan\\u00e7ar seus Eventos de Folha, para cada Funcion\\u00e1rio, atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico no portal.</p>\\n<p>Esta publica\\u00e7\\u00e3o gera automaticamente uma Compet\\u00eancia de Folha para cada Empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o. Os valores para o Status da Digita\\u00e7\\u00e3o da Folha s\\u00e3o:</p>\\n<p>Pendente - no ato da publica\\u00e7\\u00e3o de uma Compet\\u00eancia;<br>\\nDigitada - aos 100% do preenchimento, sinalizando;<br>\\nPronta - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento pelo Escrit\\u00f3rio Cont\\u00e1bil;<br>\\nImportada - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.</p>", "<p>O Operador Empresa poder\\u00e1 registrar uma Compet\\u00eancia de Folha permitindo a Digita\\u00e7\\u00e3o da Folha atrav\\u00e9s de um formul\\u00e1rio din\\u00e2mico conforme os Eventos configurados pelo Escrit\\u00f3rio Cont\\u00e1bil.</p>\\n<p>Este registro gera automaticamente uma Compet\\u00eancia de Folha para a Empresa, definindo o M\\u00eas/Ano e a Esp\\u00e9cie de Compet\\u00eancia (Quinzenal, Mensal, Complementar etc), onde ser\\u00e1 poss\\u00edvel observar o progresso (Status) da Digita\\u00e7\\u00e3o. Os valores para o Status da Digita\\u00e7\\u00e3o da Folha s\\u00e3o:</p>\\n<p>Pendente - no ato do registro de uma Compet\\u00eancia;<br>\\nPronta - marca\\u00e7\\u00e3o do Operador da empresa (cliente) sinalizando que os dados est\\u00e3o revisados e prontos para processamento pelo Escrit\\u00f3rio Cont\\u00e1bil;<br>\\nImportada - ap\\u00f3s a importa\\u00e7\\u00e3o para processamento no WFolha.</p>"], "subject": ["O Escrit\\u00f3rio Cont\\u00e1bil deseja oferecer o servi\\u00e7o de Digita\\u00e7\\u00e3o da Folha \\u00e0s empresas-cliente", "As Empresas do Escrit\\u00f3rio Cont\\u00e1bil desejam iniciar a Digita\\u00e7\\u00e3o da Folha para uma certa Compet\\u00eancia"]}
