ae6cb40c-c6d4-11e6-b231-6cf049faebf5	{"name": "Arnaldo Diniz", "pk": 13}	2016-12-20 14:52:24.310573-02	1	f	epics.epic:2	{"description_html": ["<p>A Sulprog possui uma plataforma Web chamada Portal eFolha que disponibiliza diversos servi\\u00e7os de apoio \\u00e0s suas opera\\u00e7\\u00f5es comerciais junto aos clientes (ex: emiss\\u00e3o de boletos, 2a. via, Ativa\\u00e7\\u00e3o de M\\u00f3dulos do WSolu\\u00e7\\u00e3o etc).</p>\\n<p>Os clientes que utilizam o WSolu\\u00e7\\u00e3o gostariam de ter uma forma de integra\\u00e7\\u00e3o facilitada com os seus contadores para publica\\u00e7\\u00e3o mensal dos Eventos da Folha de Pagamento.</p>\\n<p>A Sulprog entende que o Portal eFolha deve apoiar seus clientes facilitando a integra\\u00e7\\u00e3o de servi\\u00e7os entre as partes interessadas (Clientes e Contadores). Desta forma, o Portal e-Folha pode ser expandindo para atender \\u00e0s novas demandas atrav\\u00e9s de ferramentas que atendam tanto ao Cliente quanto ao Contador.</p>\\n<p>Esta ferramenta deve ser capaz de:</p>\\n<p>1) Permitir a digita\\u00e7\\u00e3o/importa\\u00e7\\u00e3o dos Eventos da Folha de Pagamento do Cliente;<br>\\n2) Oferecer ao Contador meios de processar os lan\\u00e7amentos do Cliente e retornar os resultados atrav\\u00e9s do mesmo canal.</p>\\n<p>US prov\\u00e1veis:</p>\\n<p>5&gt; Disponibiliza\\u00e7\\u00e3o da Folha de Pagamento no Portal e-Folha</p>\\n<p>Eu, Cliente WSolu\\u00e7\\u00e3o (Empresa), gostaria de disponibilizar a lista de proventos e descontos da folha de pagamento no Portal e-Folha para o meu contador.</p>\\n<p>4&gt; A Ferramenta de Integra\\u00e7\\u00e3o da Digita\\u00e7\\u00e3o da Folha no Portal e-Folha</p>\\n<p>Eu, Contador, gostaria de obter os lan\\u00e7amentos da Folha de Pagamento dos meus clientes atrav\\u00e9s do WSolu\\u00e7\\u00e3o.</p>", "<p>A Sulprog possui uma plataforma Web chamada Portal eFolha que disponibiliza diversos servi\\u00e7os de apoio \\u00e0s suas opera\\u00e7\\u00f5es comerciais junto aos clientes (ex: emiss\\u00e3o de boletos, 2a. via, Ativa\\u00e7\\u00e3o de M\\u00f3dulos do WSolu\\u00e7\\u00e3o etc).</p>\\n<p>Os clientes que utilizam o WSolu\\u00e7\\u00e3o gostariam de ter uma forma de integra\\u00e7\\u00e3o facilitada com os seus contadores para publica\\u00e7\\u00e3o mensal dos Eventos da Folha de Pagamento.</p>\\n<p>A Sulprog entende que o Portal eFolha deve apoiar seus clientes facilitando a integra\\u00e7\\u00e3o de servi\\u00e7os entre as partes interessadas (Clientes e Contadores). Desta forma, o Portal e-Folha pode ser expandido para atender \\u00e0s novas demandas atrav\\u00e9s de ferramentas que atendam tanto ao Cliente (Empresa) quanto ao Contador.</p>\\n<p>Esta ferramenta deve ser capaz de:</p>\\n<p>1) Permitir a digita\\u00e7\\u00e3o/importa\\u00e7\\u00e3o dos Eventos da Folha de Pagamento do Cliente;<br>\\n2) Oferecer ao Contador meios de processar os lan\\u00e7amentos do Cliente e retornar os resultados atrav\\u00e9s do mesmo canal.</p>\\n<p>US prov\\u00e1veis:</p>\\n<p>5&gt; Disponibiliza\\u00e7\\u00e3o da Folha de Pagamento no Portal e-Folha</p>\\n<p>Eu, Cliente WSolu\\u00e7\\u00e3o (Empresa), gostaria de disponibilizar a lista de proventos e descontos da folha de pagamento no Portal e-Folha para o meu contador.</p>\\n<p>4&gt; A Ferramenta de Integra\\u00e7\\u00e3o da Digita\\u00e7\\u00e3o da Folha no Portal e-Folha</p>\\n<p>Eu, Contador, gostaria de obter os lan\\u00e7amentos da Folha de Pagamento dos meus clientes atrav\\u00e9s do WSolu\\u00e7\\u00e3o.</p>"], "description": ["A Sulprog possui uma plataforma Web chamada Portal eFolha que disponibiliza diversos servi\\u00e7os de apoio \\u00e0s suas opera\\u00e7\\u00f5es comerciais junto aos clientes (ex: emiss\\u00e3o de boletos, 2a. via, Ativa\\u00e7\\u00e3o de M\\u00f3dulos do WSolu\\u00e7\\u00e3o etc).\\n\\nOs clientes que utilizam o WSolu\\u00e7\\u00e3o gostariam de ter uma forma de integra\\u00e7\\u00e3o facilitada com os seus contadores para publica\\u00e7\\u00e3o mensal dos Event