cab91432-cc4e-11e6-a2f8-6cf049faebf5	{"pk": 16, "name": "juliano krasucki"}	2016-12-27 14:09:06.202218-02	2	t	userstories.userstory:94	{}	{"description_html": "<p>Cliente necessita que ao inv\\u00e9s de somente alterar um par\\u00e2metro da empresa, possa tamb\\u00e9m incluir um novo par\\u00e2metro com uma nova data de vig\\u00eancia e desta forma, os c\\u00e1lculos e relat\\u00f3rios j\\u00e1 fechados anteriormente, utilize o par\\u00e2metro de cada \\u00e9poca.</p>\\n<p>Tamb\\u00e9m precisa que todos os relat\\u00f3rios e c\\u00e1lculos onde utilizem dados do par\\u00e2metro (tabela grps), o sistema posicione no par\\u00e2metro de vig\\u00eancia mais pr\\u00f3ximo do m\\u00eas/ano em quest\\u00e3o. (semelhante ao posicionaparametrofiscal).</p>\\n<p>Para as empresas que j\\u00e1 possuem os par\\u00e2metros (grps), cadastrados, o sistema tamb\\u00e9m precisa criar a data com valor default = '01/01/2000'.</p>", "kanban_order": 1482854945990, "backlog_order": 1482854945990, "sprint_order": 1482854945990, "is_blocked": false, "client_requirement": true, "tribe_gig": null, "assigned_to": null, "attachments": [], "tags": [], "milestone": null, "status": 49, "custom_attributes": [], "description": "Cliente necessita que ao inv\\u00e9s de somente alterar um par\\u00e2metro da empresa, possa tamb\\u00e9m incluir um novo par\\u00e2metro com uma nova data de vig\\u00eancia e desta forma, os c\\u00e1lculos e relat\\u00f3rios j\\u00e1 fechados anteriormente, utilize o par\\u00e2metro de cada \\u00e9poca.\\n\\nTamb\\u00e9m precisa que todos os relat\\u00f3rios e c\\u00e1lculos onde utilizem dados do par\\u00e2metro (tabela grps), o sistema posicione no par\\u00e2metro de vig\\u00eancia mais pr\\u00f3ximo do m\\u00eas/ano em quest\\u00e3o. (semelhante ao posicionaparametrofiscal).\\n\\nPara as empresas que j\\u00e1 possuem os par\\u00e2metros (grps), cadastrados, o sistema tamb\\u00e9m precisa criar a data com valor default = '01/01/2000'.", "owner": 16, "blocked_note": "", "sub