ab278a68-9c35-11e6-8b04-6cf049faebf5	{"pk": null, "name": "Jose Aroldo Rodrigues"}	2016-10-05 10:55:03-03	1	f	userstories.userstory:11	{"backlog_order": [1475667028543, 1475667028544], "description_html": ["<p>O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. Estas informa\\u00e7\\u00f5es devem estar associadas a um m\\u00eas/ano (compet\\u00eancia) e atender a um status progressivo de digita\\u00e7\\u00e3o, pronto/digitado, importado (pelo Contador para processamento da folha).</p>", "<p>O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. </p>\\n<p>O cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).</p>\\n<p>O cliente deseja visualizar uma tela onde contenha nas linhas todos os funcion\\u00e1rios <strong>ativos</strong> e nas colunas os eventos da folha. Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. <br>\\nA formata\\u00e7\\u00e3o das colunas de eventos dever\\u00e1 seguir a formata\\u00e7\\u00e3o: Time para eventos do tipo Hora e Valor com duas casas decimais para demais eventos. </p>\\n<p>Ap\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente deseja sinalizar para o contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo. Para isso, dever\\u00e1 ter os seguintes status: Em Digita\\u00e7\\u00e3o / Digitado.</p>"], "description": ["O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. Estas informa\\u00e7\\u00f5es devem estar associadas a um m\\u00eas/ano (compet\\u00eancia) e atender a um status progressivo de digita\\u00e7\\u00e3o, pronto/digitado, importado (pelo Contador para processamento da folha).", "O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. \\n\\nO cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).\\n\\nO cliente deseja visualizar uma tela onde contenha nas linhas todos os funcion\\u00e1rios **ativos** e nas colunas os eventos da folha. Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. \\nA formata\\u00e7\\u00e3o das colunas de eventos dever\\u00e1 seguir a formata\\u00e7\\u00e3o: Time para eventos do tipo Hora e Valor com duas casas decimais para demais eventos. \\n\\nAp\\u00f3s a digita\\u00e7\\u00e3o dos eventos, o cliente deseja sinalizar para o contador que o processo de digita\\u00e7\\u00e3o j\\u00e1 est\\u00e1 conclu\\u00eddo. Para isso, dever\\u00e1 ter os seguintes status: Em Digita\\u00e7\\u00e3o / Digitado.\\n\\n\\n\\n"]}	\N	{}			\N	{}	f	\N	\N	2	{"backlog_order": [1475667028543, 1475667028544], "description_diff": [null, "<span>O Cliente deseja lan\\u00e7ar eventos de folha para a Filial selecionada atrav\\u00e9s de um formul\\u00e1rio com colunas configuradas pelo Contador. </span><del style=\\"background:#ffe6e6;\\">Estas informa\\u00e7\\u00f5es devem estar associadas a um m\\u00eas/ano (compet\\u00eancia) e atender a um status progressivo de digita\\u00e7\\u00e3o, pronto/digitado, importado (pelo Contador para processamento da folha).</del><ins style=\\"background:#e6ffe6;\\"><br /><br />O cliente deseja selecionar o per\\u00edodo (m\\u00eas e ano) e a esp\\u00e9cie do c\\u00e1lculo (Mensal, Adiantamento, Complementar).<br /><br />O cliente deseja visualizar uma tela onde contenha nas linhas todos os funcion\\u00e1rios **ativos** e nas colunas os eventos da folha. Os eventos dever\\u00e3o ser organizados em dois grupos: Proventos e Descontos. <br />A formata\\u00e7\\u00e3o das colunas de eventos dever\\u00e1 seguir a formata\\u00e7\\u00e3o: Time para eve