1775	3	project:3	userstories.userstory.change	3	{"values_diff": {}, "userstory": {"subject": "#32677 - WFinanceiro Impress\\u00e3o NFCe", "ref": 17, "id": 104}, "comment_html": "<p>Pesquisas realizadas juntamente com <a class=\\"mention\\" href=\\"https://gaia.sulprog.local/profile/JoaoElias\\" title=\\"Jo\\u00e3o Elias Macedo\\">@JoaoElias</a> e <a class=\\"mention\\" href=\\"https://gaia.sulprog.local/profile/arnaldodg.sp\\" title=\\"Arnaldo Diniz\\">@arnaldodg.sp</a>, para verificar o motivo do corte da impressora em 30cm. 30/12/2016</p>\\n<p>Com as pesquisas encontramos 2 solu\\u00e7\\u00f5es.<br>\\nSolu\\u00e7\\u00e3o 1: Alterar a propriedade altura no formul\\u00e1rio, em propriedades  de servidor de impress\\u00e3o.Caminho Painel de Controle\\\\Hardware e Sons\\\\Dispositivos e Impressoras, clicar na impressora e clicar em \\"propriedades  de servidor de impress\\u00e3o\\".</p>\\n<p>Solu\\u00e7\\u00e3o 2: Alterar o PrintMode do relat\\u00f3rio para pmSplit, adicionar um footer no relat\\u00f3rio e manter o papersize como Custom; Aplicada e funcionando no cliente.</p>", "user": {"id": 16}, "comment_edited": true, "comment": "Pesquisas realizadas juntamente com @JoaoElias e @arnaldodg.sp, para verificar o motivo do corte da impressora em 30cm. 30/12/2016\\n\\nCom as pesquisas encontramos 2 solu\\u00e7\\u00f5es.\\nSolu\\u00e7\\u00e3o 1: Alterar a propriedade altura no formul\\u00e1rio, em propriedades  de servidor de impress\\u00e3o.Caminho Painel de Controle\\\\Hardware e Sons\\\\Dispositivos e Impressoras, clicar na impressora e clicar em \\"propriedades  de servidor de impress\\u00e3o\\".\\n\\nSolu\\u00e7\\u00e3o 2: Alterar o PrintMode do relat\\u00f3rio para pmSplit, adicionar um footer no relat\\u00f3rio e manter o papersize como Custom; Aplicada e funcionando no cliente.", "project": {"description": "Ciclo de vida da suite de SW WSolu\\u00e7\\u00e3o na vers\\u00e3o 2 utilizando Postgres 9", "slug": "arnaldodgsp-kanban-test", "name": "WSolu\\u00e7\\u00e3o V